import React from "react";
import Tour from "./Detail";
import Header from "./Header";

const Tours = ({ tours, removeTour }) => {
  return (
    <section>
      <Header/>
      <div>
        {tours.map((tour) => {
          return <Tour key={tour.id} {...tour} removeTour={removeTour} />;
        })}
      </div>
    </section>
  );
};

export default Tours;
